import React, { Component } from 'react';
import { Button, FormGroup, FormControl} from "react-bootstrap";

import '../logins.css';
import Icons from './Icons';
class Logins extends Component {
    constructor(props){
        super(props);
        this.state = {
            Email: "",
            Password: ""
        }
    }
    handelChange = (e) =>{
        let change = {}
        let change2 = {}
        change[e.target.Email] = e.target.value
        changel2[e.target.Password] = e.target.v
        this.setState(change)
    }
    handelSummit = (e) =>{
         e.preventDefault();
    }
    validateForm(){
        return this.state.Email.length > 0 && this.state.Password.length > 0;
    }
    render() {
        return (
            <div className = "container">
                <form onSummit = {this.handelSummit}>
                <FormGroup controlId="email" bsSize="large">
            <label>Email</label>
            <FormControl
              autoFocus
              type="email"
              value={this.state.email}
              onChange={this.handleChange}
            />
          </FormGroup>
          <FormGroup controlId="password" bsSize="large">
            <label>Password</label>
            <FormControl
              value={this.state.password}
              onChange={this.handleChange}
              type="password"
            />
          </FormGroup>
                <Button block bsSize="large" disabled={!this.validateForm()} type="submit" className = "btn2 btn btn-secondary btn-lg">
            Login
          </Button>
                <div className = "label2">
                <label>Sign in with</label>
                <Icons />
                </div>
                </form>

            </div>

        )
      }
    } 

export default Logins;
